CREATE DEFINER=`swm`@`%` PROCEDURE `count_emp_by_sex`(
IN p_sex varchar(20),
IN p_age int,
out p_count int
)
BEGIN
select count(*)
from employee 
where sex= p_sex and age > p_age
into p_count;  
END ;;
